import React from 'react'
import { useData } from '../contexts/DataContext'

function Customer() {
    const { menus } = useData();

    return (
        <div>
            <text>Hi</text>
            {menus.map( menu => <h1>{menu.id}</h1>)}
        </div>
    )
}

export default Customer
